import React, { Component } from 'react';

class About extends Component {
    render() {
        return (
            <div className="view">
                <h1>About</h1>
                <div className="content">
                    <div className="content-inner">
                        About application to be filled in later.
                    </div>
                </div>
            </div>
        )
    }
}

export default About
